import React, { Component } from 'react';
import './App.css';
import Home from './pages/Home';
import { BrowserRouter as Router, Route } from 'react-router-dom';

class App extends Component {
  render() {
    return (

      <Router>
          <div>
            <Route exact path="/" component={Home} />
          </div>
      </Router> 
    );
  }
}


export default App;
